import Layout from '../components/layout/primaryLayout';
import Link from 'next/link';
import { sizing } from '@material-ui/system';
import { Grid, Typography, Button } from '@material-ui/core';

const Home = () => {
	return (
		<Layout>
			<Grid container justify="center" alignItems="center" height="100vh">
				<Typography style={{ display: "block" }}>
					Call For Help
				</Typography>
				<Link passHref prefetch href="/ic">
					<Button variant="contained" color="primary">IC</Button>
				</Link>
				<Link passHref prefetch href="/maintenance">
					<Button variant="contained" color="primary">Maintenance</Button>
				</Link>
			</Grid>
		</Layout>
	)
}

export default Home
